DROP TABLE IF EXISTS `account`;
CREATE TABLE `account` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `login_username` varchar(24) NOT NULL COMMENT '登录账号',
  `login_password_md5` varchar(32) NOT NULL COMMENT 'md5密码',
  `account_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '账号类型',
  `spid` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '渠道id',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `login_username` (`login_username`)
) ENGINE=InnoDB AUTO_INCREMENT=5018 DEFAULT CHARSET=utf8;

