-- ----------------------------
-- Procedure structure for `SP_CREATE_ACCOUNT`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_CREATE_ACCOUNT`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_CREATE_ACCOUNT`(IN param1 INTEGER(11))
BEGIN
    declare init_loop_index bigint default 10;
		declare init_login_name varchar(24) default "";
    
    repeat set init_loop_index = init_loop_index + 1;
				set init_login_name = concat("test", convert(init_loop_index, char));
		values(init_login_name, "c4ca4238a0b923820dcc509a6f75849b", 0,now());
        
    until init_loop_index >= 5000 end repeat;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `SP_GET_ACCOUNT_LOGINDATA`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_GET_ACCOUNT_LOGINDATA`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_GET_ACCOUNT_LOGINDATA`(IN p_name VARCHAR(24))
BEGIN
		declare t_id bigint default 0;
   	declare t_password varchar(32) default "";
   	declare t_login_type tinyint default 0;
		declare t_spid smallint default 0;
    
		start transaction;
			select `id`,`login_password_md5`,`account_type`, `spid` into t_id,t_password,t_login_type, t_spid from `account` where `account`.`login_username`=p_name;
			select t_id,t_password,t_login_type, t_spid;
    commit;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `SP_LOGIN_ACCOUNT`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_LOGIN_ACCOUNT`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_LOGIN_ACCOUNT`(IN p_account_id BIGINT,
        IN p_cluster_id INTEGER UNSIGNED)
BEGIN
  	declare temp_server_id bigint unsigned default 0;
  	declare temp_conn_id bigint unsigned;
  	declare temp_login_status int unsigned default 0;
  	declare temp_error int unsigned default 0;
    
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    	begin
            rollback;
            set temp_error = 1;
            select temp_login_status, temp_error;
        end;
    start transaction;
  	
	set temp_conn_id = CONNECTION_ID();
    
    select dp_conn_id into temp_server_id from `login_status` where account_id = p_account_id;
    if temp_server_id = 0 then
    else
    	set temp_login_status = 1;
    end if;
    
    commit;
    
    select temp_login_status, temp_error;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `SP_LOGOUT_ACCOUNT`
-- ----------------------------
DROP PROCEDURE IF EXISTS `SP_LOGOUT_ACCOUNT`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `SP_LOGOUT_ACCOUNT`(IN p_account_id BIGINT)
BEGIN
	declare exit handler for SQLEXCEPTION rollback;
   	start transaction;
   	
    delete from login_status where login_status.account_id = p_account_id;
    
   	commit;
END
;;
DELIMITER ;
